import React from 'react';
import 'react-native-gesture-handler';
import {NavigationContainer} from '@react-navigation/native';
import {createBottomTabNavigator} from '@react-navigation/bottom-tabs';
import { StyleSheet, StatusBar, View} from 'react-native';
import Ionicons from "react-native-vector-icons/Ionicons";
import HomeScreen from './src/Componentes/HomeScreen';
import Produtos from './src/Componentes/Produtos';
import Detalhes from './src/Componentes/Detalhes';


const Tab = createBottomTabNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <StatusBar/>

      <Tab.Navigator initialRouteName="Home" screenOptions={({route}) => ({
        tabBarIcon: ({color,size}) => {
          let iconName;
          switch(route.name){
            case "Home":
              iconName = "home";
              break;
            case "Produtos":
              iconName = "fast-food-outline";
            break;
            case "Detalhes":
              iconName = "skull-outline";
            break; 
          } 
          return<Ionicons name={iconName} size={size} color={color} />
        }
        }) } 

        tabBarOptions={{
          activeTintColor: 'red',
          inactiveTintColor: 'purple',
        }}>


        <Tab.Screen name='Home' component={HomeScreen}/>
        <Tab.Screen name='Produtos' component={Produtos}/>
        <Tab.Screen name='Detalhes' component={Detalhes}/>

      </Tab.Navigator>

  </NavigationContainer>
  );
}
